import "./timeline.css";

const Timeline = () => {
  return (
    <div className="t" id="timeline">
      <div className="t-wrapper">
        <div className="t-row-1">
          <section>
            <div className="t-details">
              <span className="t-title">Title of Section 1</span>
            </div>
          </section>
        </div>
      </div>
    </div>
  );
};

export default Timeline;
